import java.util.*;

/**
 * @author Avinash Vijayakumar
 * 2019-01-07
 */
public class Solution {
    public static void main(String[] args) {
        String s= "";
        System.out.println(substrCount(s.length(),s));

    }

    private static int charCount(String s,int len){
        Set<Character> charcount = new HashSet<>();
        for(int i=0;i<len;i++)
            charcount.add(s.charAt(i));
        return charcount.size();
    }

    private static boolean checkPalindrome(String s, int len){
        Stack<Character> stack = new Stack<Character>();
        boolean middlepoint = false;
        try{
            for(int i=0;i<len;i++){
                if(!middlepoint){
                    if(i==0 )
                        stack.push(s.charAt(i));
                    else if(stack.peek()==s.charAt(i))
                        stack.push(s.charAt(i));
                    else if(stack.peek()!=s.charAt(i)){
                        middlepoint = true;
                    }
                }
                else{
                    if(stack.pop()!=s.charAt(i))
                        return false;
                }
            }
            return stack.empty();
        }catch(Exception e){
            return false;
        }

    }

    private static boolean checkSubstr(String s, int len){
        if(len==1)
            return true;

        int charcount = charCount(s,len);
        if(1==charcount)
            return true;

        if(2==charcount){
            return checkPalindrome(s, len);
        }
        return false;
    }

    static long substrCount(int n, String s) {
        // all possible substrings.
        List<String> substr = new ArrayList<>();
        for(int i=0;i<n;i++) {
            for (int j = i + 1; j < n+1; j++) {
                substr.add(s.substring(i, j));
            }
        }
        long totalcount = 0;
        for(String i:substr){
            if(checkSubstr(i, i.length()))
                totalcount++;
        }
        return totalcount;
    }
}

